import React from 'react'; 
import PropTypes from 'prop-types'; 
import { connect } from 'react-redux'; 

const Dashboard = props => {
    return <div>Dashboard</div>
}  

Dashboard.propTypes = {}; 

export default connect(mapToStateToProps, { getCurrentProfile }) (Dashboard);
